📣 Taking this moment to honor Pastor Chuck and Renee Reynolds for their friendship and how they have mentored my husband and I! You both are a true example of Christ 😭 

🎊 Happy Birthday my sweet friends, love you so much! In a time where I've struggled to see godly leadership in people I once thought I respected, you both have been pillars of the faith to Renn and I. For that I am eternally grateful 🙏🏼 Thank you for keeping the standard in Christ, for being prayerful, discerning and seeing us they way God does. We hope to be more like you, as you are more like Jesus ❤️ Love you!!!

